      <button
        type="button"
        className="w-full mt-4 font-sans text-primary-600 font-medium rounded-lg text-sm px-5 py-2.5 text-center dark:bg-primary-600"
        onClick={handleClick(btn.navigateTo)}
      >
        {btn.text}
      </button>
    );
  }
}
